import React, { useState, useEffect } from 'react';
import { ArrowLeft, ArrowRight, Play, Pause } from 'lucide-react';
import { useNavigate } from 'react-router-dom';

const FrequencyCountPage = () => {
  const navigate = useNavigate();
  const [inputValue, setInputValue] = useState('');
  const [array, setArray] = useState<number[]>([]);
  const [frequency, setFrequency] = useState<{ [key: number]: number }>({});
  const [currentStep, setCurrentStep] = useState(0);
  const [isPlaying, setIsPlaying] = useState(false);
  const [currentElement, setCurrentElement] = useState<number | null>(null);

  const handleArrayInput = (value: string) => {
    const numbers = value.split(',').map(num => parseInt(num.trim())).filter(num => !isNaN(num));
    setArray(numbers);
    setCurrentStep(0);
    setFrequency({});
    setCurrentElement(null);
  };

  const handleNext = () => {
    if (currentStep < array.length) {
      const newFrequency = { ...frequency };
      const currentNum = array[currentStep];
      newFrequency[currentNum] = (newFrequency[currentNum] || 0) + 1;
      setFrequency(newFrequency);
      setCurrentElement(currentNum);
      setCurrentStep(currentStep + 1);
    }
  };

  const handlePrevious = () => {
    if (currentStep > 0) {
      const newFrequency = { ...frequency };
      const prevNum = array[currentStep - 1];
      newFrequency[prevNum]--;
      if (newFrequency[prevNum] === 0) {
        delete newFrequency[prevNum];
      }
      setFrequency(newFrequency);
      setCurrentElement(prevNum);
      setCurrentStep(currentStep - 1);
    }
  };

  useEffect(() => {
    let interval: NodeJS.Timeout;
    if (isPlaying && currentStep < array.length) {
      interval = setInterval(handleNext, 1000);
    } else if (currentStep >= array.length) {
      setIsPlaying(false);
    }
    return () => clearInterval(interval);
  }, [isPlaying, currentStep, array]);

  return (
    <div className="min-h-screen bg-gradient-to-br from-slate-50 via-white to-slate-100">
      <div className="max-w-7xl mx-auto py-8 px-4 sm:px-6 lg:px-8">
        <div className="mb-8">
          <button
            onClick={() => navigate('/array-algorithms')}
            className="inline-flex items-center px-4 py-2 text-sm font-medium text-gray-700 bg-white border border-gray-300 rounded-md hover:bg-gray-50 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-blue-500"
          >
            <ArrowLeft className="w-4 h-4 mr-2" />
            Back to Algorithms
          </button>
        </div>

        <div className="bg-white rounded-2xl shadow-lg p-6 mb-8">
          <h1 className="text-3xl font-bold text-gray-900 mb-4">Frequency Count</h1>
          <p className="text-gray-600 mb-6">
            Count the frequency of each element in the array.
          </p>

          <div className="mb-6">
            <label htmlFor="array-input" className="block text-sm font-medium text-gray-700 mb-2">
              Enter array (comma-separated numbers)
            </label>
            <input
              type="text"
              id="array-input"
              value={inputValue}
              onChange={(e) => setInputValue(e.target.value)}
              onBlur={(e) => handleArrayInput(e.target.value)}
              className="w-full px-4 py-2 border border-gray-300 rounded-md focus:ring-2 focus:ring-blue-500 focus:border-blue-500"
              placeholder="e.g., 1, 2, 3, 1, 2"
            />
          </div>

          <div className="flex space-x-4 mb-8">
            <button
              onClick={handlePrevious}
              disabled={currentStep === 0}
              className="inline-flex items-center px-4 py-2 text-sm font-medium text-gray-700 bg-white border border-gray-300 rounded-md hover:bg-gray-50 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-blue-500 disabled:opacity-50 disabled:cursor-not-allowed"
            >
              <ArrowLeft className="w-4 h-4 mr-2" />
              Previous
            </button>
            <button
              onClick={() => setIsPlaying(!isPlaying)}
              className="inline-flex items-center px-4 py-2 text-sm font-medium text-white bg-blue-600 border border-transparent rounded-md hover:bg-blue-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-blue-500"
            >
              {isPlaying ? (
                <>
                  <Pause className="w-4 h-4 mr-2" />
                  Pause
                </>
              ) : (
                <>
                  <Play className="w-4 h-4 mr-2" />
                  Play
                </>
              )}
            </button>
            <button
              onClick={handleNext}
              disabled={currentStep >= array.length}
              className="inline-flex items-center px-4 py-2 text-sm font-medium text-gray-700 bg-white border border-gray-300 rounded-md hover:bg-gray-50 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-blue-500 disabled:opacity-50 disabled:cursor-not-allowed"
            >
              Next
              <ArrowRight className="w-4 h-4 ml-2" />
            </button>
          </div>

          <div className="grid grid-cols-1 md:grid-cols-2 gap-8">
            <div className="bg-gray-50 rounded-lg p-6">
              <h2 className="text-xl font-semibold text-gray-900 mb-4">Current State</h2>
              <div className="space-y-4">
                <div>
                  <h3 className="text-sm font-medium text-gray-500">Array</h3>
                  <div className="flex flex-wrap gap-2 mt-2">
                    {array.map((num, index) => (
                      <div
                        key={index}
                        className={`px-3 py-1 rounded-md ${
                          index === currentStep - 1
                            ? 'bg-blue-100 text-blue-800'
                            : index < currentStep
                            ? 'bg-gray-100 text-gray-800'
                            : 'bg-white text-gray-800 border border-gray-200'
                        }`}
                      >
                        {num}
                      </div>
                    ))}
                  </div>
                </div>
                <div>
                  <h3 className="text-sm font-medium text-gray-500">Current Element</h3>
                  <div className="mt-2">
                    {currentElement !== null ? (
                      <span className="inline-block px-3 py-1 bg-blue-100 text-blue-800 rounded-md">
                        {currentElement}
                      </span>
                    ) : (
                      <span className="text-gray-500">-</span>
                    )}
                  </div>
                </div>
                <div>
                  <h3 className="text-sm font-medium text-gray-500">Frequency Map</h3>
                  <div className="flex flex-wrap gap-2 mt-2">
                    {Object.entries(frequency).map(([num, count]) => (
                      <div
                        key={num}
                        className="px-3 py-1 bg-gray-100 text-gray-800 rounded-md"
                      >
                        {num}: {count}
                      </div>
                    ))}
                  </div>
                </div>
              </div>
            </div>

            <div className="bg-gray-50 rounded-lg p-6">
              <h2 className="text-xl font-semibold text-gray-900 mb-4">Implementation</h2>
              <pre className="bg-gray-800 text-gray-100 p-4 rounded-lg overflow-x-auto">
                <code>{`function frequencyCount(arr) {
  const frequency = {};
  
  for (let i = 0; i < arr.length; i++) {
    const num = arr[i];
    frequency[num] = (frequency[num] || 0) + 1;
  }
  
  return frequency;
}`}</code>
              </pre>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default FrequencyCountPage;
